import React, { useState } from 'react'
import './styles/style.css'
import useInterval from './useInterval'

function App() {
  
  const [left, setLeft] = useState(95)
  const style = {
    left: `${left}%`
  }
  
  function moveObject(){
    setLeft((item)=> item-5)
  }

 let moveInterval =  useInterval(moveObject,2000)
  console.log(left)

  if(left<=0){
    clearInterval(moveInterval)
  }

  const obstacle = (<div className="obstacle" style={style}></div>)

  return (
    <div className="canvas">
    </div>
  )
}

export default App
